window.bookSummaryJSON = "<p><b>I tried to run. I tried to hide. But look where it got me: captured and held firmly in the grasp of my HellBeast King.</b></p> <p>One still intent on completing the claim he feels he has on me. Which I knew meant only one thing: making me his—in every single way. By claiming my heart, then my blood, and now the very last thing left of me to give…</p> <p>He wants my body.</p> <p>But after having my heart trampled on, and after I had been willing to hand it over freely...</p> <p>Will I now finally accept what he calls my fate?</p> <p>Will I let go of my fears of having my heart broken again?</p> <p>Or will I forever now have to be... The HellBeast’s Prisoner?</p>"; 
